(window.webpackJsonp=window.webpackJsonp||[]).push([[108],{921:function(n,t){n.exports="/*\n=====================================================================\n*   Keep It Simple v2.0 Layout Stylesheet\n*   url: styleshout.com\n*   07-12-2014\n=====================================================================\n\n   TOC:\n   a. Default Overrides and Common Styles\n   b. Header Styles\n   c. Content\n   d. Sidebar\n   e. Entry\n   f. Archives\n   g. Footer\n \n===================================================================== */\n/* a. Default Overrides and Common Styles\n/* ------------------------------------------------------------------ */\nbody {\n  background: #F6F5F5;\n  border-top: 6px solid #9FCC7F; }\n\n.page {\n  padding-bottom: 18px;\n  margin-bottom: 36px; }\n\n.page h2 {\n  font: 31px/36px 'opensans-semibold', sans-serif;\n  margin-bottom: 0;\n  letter-spacing: -.5px; }\n\n.page h2 {\n  color: #444;\n  margin-bottom: 18px; }\n\n/* b. Header Styles\n/* ------------------------------------------------------------------ */\nheader {\n  width: 100%;\n  height: 288px;\n  background: #fff; }\n\nheader .header-content {\n  background: #fff url(/css/img/header-content-bg.png) no-repeat right top;\n  height: 288px;\n  border-bottom: 1px dashed #E8E8E8;\n  position: relative; }\n\n/* For high-res devices */\n@media (-webkit-min-device-pixel-ratio: 2), (min-resolution: 192dpi) {\n  header .header-content {\n    background: #fff url(/css/img/header-content-bg_@2x.png) no-repeat right top;\n    background-size: 361px 256px; } }\n\n/* header logo */\nheader #logo-text {\n  margin: 0;\n  padding: 0;\n  /* change the values of top and left to adjust the position of the logo text */\n  position: absolute;\n  top: 108px;\n  left: 18px; }\n\nheader #logo-text a {\n  margin: 0;\n  padding: 0;\n  font: normal 75px Georgia, Serif;\n  letter-spacing: -5px;\n  color: #93b876;\n  text-decoration: none; }\n\nheader #intro {\n  margin: 0;\n  padding: 0;\n  font: 16px/24px 'opensans-light', Georgia, Serif;\n  font-weight: normal;\n  color: #C8C8C8;\n  width: 400px;\n  /* change the values of top and left to adjust the position */\n  position: absolute;\n  top: 192px;\n  left: 30px; }\n\n/* primary navigation\n--------------------------------------------------------------------- */\n#nav-wrap, #nav-wrap ul, #nav-wrap li, #nav-wrap a {\n  margin: 0;\n  padding: 0;\n  border: none;\n  outline: none; }\n\n/* nav-wrap */\n#nav-wrap {\n  font: 12px 'opensans-bold', sans-serif;\n  text-transform: uppercase;\n  letter-spacing: 2px;\n  background: #F5F4F3;\n  border-bottom: 1px solid #EAE8E8;\n  width: 100%;\n  float: left;\n  position: absolute;\n  top: 6px;\n  left: 0; }\n\n/* hide toggle button */\n#nav-wrap > a {\n  display: none; }\n\nul#nav {\n  min-height: 50px;\n  width: auto;\n  margin-left: 20px;\n  float: left;\n  position: relative;\n  top: 0;\n  /* left align the menu */\n  text-align: left; }\n\nul#nav li {\n  position: relative;\n  list-style: none;\n  height: 50px;\n  display: inline-block;\n  padding-top: 10px; }\n\n/* float left to remove gaps between 1st level list items */\nul#nav > li {\n  float: left; }\n\n/* Links */\nul#nav li a {\n  display: inline-block;\n  padding: 0 15px;\n  line-height: 40px;\n  text-decoration: none;\n  color: #666666;\n  -webkit-transition: color .2s ease-in-out;\n  -moz-transition: color .2s ease-in-out;\n  -o-transition: color .2s ease-in-out;\n  -ms-transition: color .2s ease-in-out;\n  transition: color .2s ease-in-out; }\n\nul#nav li a:hover {\n  color: #222; }\n\nul#nav li a:active {\n  background-color: transparent !important; }\n\nul#nav li.current > a {\n  background: #fff;\n  padding: 0 14px;\n  border-right: 1px solid #EAE8E8;\n  border-top: 1px solid #EAE8E8;\n  border-left: 1px solid #EAE8E8;\n  border-radius: 3px 3px 0 0; }\n\n/* sub menu */\nul#nav ul {\n  position: absolute;\n  top: 52px;\n  left: 0px;\n  padding-bottom: 12px;\n  background: #F5F4F3;\n  min-width: 100%;\n  border: 1px solid #EAE8E8;\n  border-top: none;\n  border-radius: 0 0 3px 3px;\n  /* for transition effects */\n  opacity: 0;\n  filter: alpha(opacity=0);\n  -webkit-transition: opacity .25s ease .1s;\n  -moz-transition: opacity .25s ease .1s;\n  -o-transition: opacity .25s ease .1s;\n  -ms-transition: opacity .25s ease .1s;\n  transition: opacity .25s ease .1s; }\n\n/* \nul#nav ul ul {\n\tposition: absolute;\n\ttop: 0;\n\tleft: 100%;\n\tborder-radius: 0 3px 3px 0;\n}\n*/\nul#nav ul li {\n  padding: 0;\n  display: block;\n  text-align: left;\n  /* for transition effects */\n  height: 0;\n  overflow: hidden;\n  -webkit-transition: height .25s ease .1s;\n  -moz-transition: height .25s ease .1s;\n  -o-transition: height .25s ease .1s;\n  -ms-transition: height .25s ease .1s;\n  transition: height .25s ease .1s; }\n\n/* on hover */\nul#nav li:hover > ul {\n  opacity: 1;\n  filter: alpha(opacity=100); }\n\nul#nav li:hover > ul li {\n  height: 42px;\n  overflow: visible; }\n\n/* sub menu anchor links */\nul#nav ul li a {\n  padding: 6px 20px;\n  margin: 0;\n  white-space: nowrap;\n  font-size: 13px;\n  font-family: 'opensans-regular', sans-serif;\n  text-transform: none;\n  letter-spacing: 0; }\n\n/* c. Content\n--------------------------------------------------------------------- */\n#content-wrap {\n  background: #fff;\n  padding: 42px 0 36px 0; }\n\n#content-wrap #main {\n  padding-right: 40px; }\n\n/* d. Sidebar \n--------------------------------------------------------------------- */\n#sidebar {\n  padding-top: 0px;\n  padding-left: 40px; }\n\n#sidebar h3 {\n  font: 15px/24px 'opensans-bold', sans-serif;\n  text-transform: uppercase;\n  letter-spacing: 1px; }\n\n#sidebar .widget {\n  margin-bottom: 18px; }\n\n#sidebar p {\n  margin-bottom: 12px; }\n\n#sidebar hr {\n  margin-bottom: 24px; }\n\n/* search  */\n#sidebar .widget_search {\n  padding-top: 0;\n  margin-bottom: 36px; }\n\n#sidebar .widget_search h3 {\n  display: none; }\n\n#sidebar .widget_search form {\n  position: relative;\n  margin: 0; }\n\n#sidebar .widget_search .text-search {\n  padding-right: 40px;\n  border: none;\n  width: 100%;\n  min-width: 150px;\n  border-radius: 3px; }\n\n#sidebar .widget_search .submit-search {\n  background: url(/css/img/search-icon.png) no-repeat;\n  box-shadow: none;\n  border: none;\n  cursor: pointer;\n  width: 18px;\n  height: 18px;\n  min-height: 18px;\n  margin: -9px 0 0 0;\n  padding: 0;\n  position: absolute;\n  top: 50%;\n  right: 18px; }\n\n@media (-webkit-min-device-pixel-ratio: 2), (min-resolution: 192dpi) {\n  #sidebar .widget_search .submit-search {\n    background: url(/css/img/search-icon_@2x.png) no-repeat;\n    background-size: 18px 18px; } }\n\n/* categories  */\n#sidebar .widget_categories ul {\n  margin-top: 12px;\n  margin-bottom: 24px; }\n\n/* link List */\n#sidebar .link-list {\n  padding: 0;\n  margin: 18px 0 24px 0; }\n\n#sidebar .link-list li {\n  font: 15px/30px 'merriweather-regular', sans-serif;\n  padding: 8px 0;\n  margin: 0;\n  border-bottom: 1px dotted #E6E6E6; }\n\n#sidebar .link-list li:first-child {\n  border-top: 1px dotted #E6E6E6; }\n\n#sidebar .link-list li a {\n  color: #4A5153; }\n\n#sidebar .link-list li a:hover {\n  color: #313131;\n  /* color: #93B876; */ }\n\n/* tag cloud */\n#sidebar .tagcloud {\n  margin: 18px 0 24px -12px;\n  padding: 0;\n  font-size: 17px; }\n\n#sidebar .tagcloud a {\n  font: 12px/24px 'opensans-bold', sans-serif !important;\n  display: inline-block;\n  float: left;\n  margin: 0 0 12px 12px;\n  padding: 6px 15px;\n  position: relative;\n  text-transform: uppercase;\n  letter-spacing: 0.5px;\n  background: #E9EBEE;\n  text-decoration: none;\n  letter-spacing: .5px;\n  color: #778888;\n  -webkit-transition: all .2s ease-in-out;\n  -moz-transition: all .2s ease-in-out;\n  -o-transition: all .2s ease-in-out;\n  -ms-transition: all .2s ease-in-out;\n  transition: all .2s ease-in-out;\n  border-radius: 3px; }\n\n#sidebar .tagcloud a:hover {\n  color: #fff;\n  background: #93B876; }\n\n/* Comments -------------------------------------------- */\n#comments {\n  padding-top: 12px;\n  padding-bottom: 12px; }\n\n#comments h3 {\n  font: 20px/30px 'opensans-bold', sans-serif;\n  margin-bottom: 6px; }\n\n/* Comments List */\nol.commentlist {\n  border-top: 1px dotted #E1E5E3;\n  margin: 29px 0 54px 0;\n  padding: 0; }\n\n.commentlist > li {\n  position: relative;\n  list-style: none;\n  margin: 0;\n  border-bottom: 1px dotted #D9DEDB;\n  padding: 24px 0 17px 0;\n  padding-left: 14%; }\n\n.commentlist li .avatar {\n  position: absolute;\n  left: 0px;\n  display: block;\n  height: 48px;\n  width: 48px; }\n\n.commentlist li .avatar img {\n  margin-top: 6px;\n  height: 48px;\n  width: 48px;\n  border-radius: 100%; }\n\n.commentlist li .comment-info cite {\n  font: 16px/30px 'opensans-bold', sans-serif;\n  color: #454545; }\n\n.commentlist li .comment-info .comment-meta {\n  font-size: 14px;\n  line-height: 24px;\n  display: block; }\n\n.commentlist li .comment-info .comment-meta .reply {\n  font-family: 'opensans-bold', sans-serif; }\n\n.commentlist li .comment-info .comment-meta .sep {\n  margin: 0 5px;\n  color: #AEB6B7; }\n\n.commentlist li .comment-text {\n  clear: both;\n  margin: 18px 0 0 0;\n  padding: 0;\n  line-height: 30px; }\n\n/* children */\n.commentlist li ul.children {\n  margin: 0;\n  padding: 18px 0 0 0; }\n\n.commentlist li ul.children li {\n  padding-left: 5%;\n  padding-top: 17px;\n  border-top: 1px dotted #D9DEDB; }\n\n/* comment form ----------------------------------------- */\n#comments form {\n  margin-top: 36px; }\n\n#comments form label {\n  padding-left: 24px;\n  width: 41.66667%;\n  float: right; }\n\n#comments form div {\n  margin: 12px 0 18px 0; }\n\n#comments form input,\n#comments form textarea,\n#comments form select {\n  width: 58.33333%;\n  float: left; }\n\n#comments form .message label {\n  display: none; }\n\n#comments form textarea {\n  width: 100%; }\n\n#comments form button.submit {\n  text-transform: uppercase;\n  letter-spacing: 2px;\n  display: block;\n  margin-top: 12px; }\n\n#comments form span.required {\n  color: #93B876;\n  font-size: 15px; }\n\n/* page navigation -------------------------------------- */\n.pagenav {\n  font: 18px/30px 'opensans-bold', sans-serif;\n  text-align: left;\n  margin-top: 12px;\n  padding-top: 18px;\n  margin-bottom: 48px;\n  border-top: 1px solid #E8E8E8; }\n\n.pagenav p {\n  margin-bottom: 18px; }\n\n.pagenav span {\n  font: 18px/30px 'opensans-regular', sans-serif;\n  color: #C0C6C9;\n  margin: 0 15px; }\n\n.pagenav a[rel=\"prev\"] {\n  margin-right: 10px;\n  padding-right: 15px;\n  border-right: 1px dotted #CBCFD1; }\n\n.pagenav a[rel=\"prev\"]:before {\n  /*content: '\\f053';*/\n  /*content: '\\f104';*/\n  content: '\\f177';\n  font-family: 'fontawesome';\n  font-size: 15px;\n  margin-right: 12px; }\n\n.pagenav a[rel=\"next\"]:after {\n  /*content: '\\f054';*/\n  /*content: '\\f105';*/\n  content: '\\f178';\n  font-family: 'fontawesome';\n  font-size: 15px;\n  margin-left: 12px; }\n\n/* f. Archives\n/* ------------------------------------------------------------------ */\n.archive-list h4 {\n  font: 15px/24px 'opensans-bold', sans-serif;\n  text-transform: uppercase;\n  letter-spacing: 1px; }\n\n.archive-list ul {\n  list-style: disc;\n  margin-left: 17px; }\n\n/* g. Footer\n/* ------------------------------------------------------------------ */\nfooter {\n  padding-top: 36px;\n  margin-bottom: 42px;\n  font-size: 13px;\n  line-height: 24px;\n  position: relative;\n  color: #34393A; }\n\nfooter h3 {\n  font: 14px/24px 'opensans-bold', sans-serif;\n  margin-bottom: 9px;\n  font-weight: normal;\n  text-transform: uppercase;\n  letter-spacing: 1px; }\n\nfooter p {\n  margin-bottom: 24px; }\n\nfooter a, footer a:visited {\n  color: #6C934D; }\n\nfooter a:hover, footer a:focus {\n  color: #34393A; }\n\nfooter .info {\n  padding-right: 30px; }\n\nfooter ul {\n  margin: 0;\n  padding: 0; }\n\nfooter ul li {\n  margin: 0;\n  line-height: 24px; }\n\nfooter ul li a,\nfooter ul li a:visited {\n  color: #34393A; }\n\nfooter ul li a:hover,\nfooter ul li a:focus {\n  color: #6C934D; }\n\n/* social links */\nfooter .social-links {\n  margin: 18px auto 42px auto;\n  padding: 0;\n  text-align: center; }\n\nfooter .social-links li {\n  display: inline-block;\n  font-size: 32px;\n  line-height: 48px;\n  padding: 0;\n  margin: 0 16px;\n  color: #444; }\n\nfooter .social-links li:first-child {\n  margin-left: 0; }\n\n/* Photostream */\nfooter .photostream {\n  list-style: none;\n  margin: 12px 0 24px -15px;\n  padding: 0;\n  overflow: hidden; }\n\nfooter .photostream li {\n  display: inline-block;\n  margin: 0 0 12px 12px;\n  padding: 0; }\n\nfooter .photostream li a {\n  display: block;\n  height: 60px;\n  width: 60px;\n  background: #fff;\n  padding: 9px;\n  border: 1px solid #E9E9E9;\n  border-radius: 3px; }\n\nfooter .photostream li a img {\n  vertical-align: bottom; }\n\n/* copyright */\nfooter .copyright {\n  margin: 0;\n  padding: 24px 18px 6px 18px;\n  clear: both;\n  text-align: center; }\n\n/* Go To Top Button */\n#go-top {\n  position: fixed;\n  bottom: 30px;\n  right: 30px;\n  text-align: center;\n  display: none; }\n\n#go-top a {\n  text-decoration: none;\n  border: 0 none;\n  display: block;\n  width: 48px;\n  height: 48px;\n  background-color: #494949;\n  -webkit-transition: all 0.2s ease-in-out;\n  -moz-transition: all 0.2s ease-in-out;\n  -o-transition: all 0.2s ease-in-out;\n  -ms-transition: all 0.2s ease-in-out;\n  transition: all 0.2s ease-in-out;\n  color: #fff;\n  font-size: 16px;\n  line-height: 48px;\n  border-radius: 3px; }\n\n#go-top a:hover {\n  background: #7BA857; }\n"}}]);